def find_smallest_x(n: int, k: int) -> int:
    INF = 10 * 20
    res = INF
    for d in range(10):
        for k_count in range(17):
            tmp = 0
            for i in range(k + 1):
                if d + i <= 9:
                    tmp += 9 * k_count + d + i
                else:
                    tmp += 1 + (d + i) - 10
            if n >= tmp and (n - tmp) % (k + 1) == 0:
                s = (n - tmp) // (k + 1)
                if s <= 8:
                    prefix = str(s)
                else:
                    prefix = str((s - 8) % 9) + '9' * ((s - 8) // 9) + '8'
                prefix += '9' * k_count
                prefix += str(d)
                x = int(prefix)
                if sum((sum((int(c) for c in str(x + i))) for i in range(k + 1))) == n:
                    res = min(res, x)
    return res if res != INF else -1

